import axios from "axios";
import { getPost } from "../api/PostApi"
import api from "../api/PostApi";
export const getPosts = () => async(dispatch) => {
    try {
        const {data}= await getPost()
        console.log(data);
        return dispatch({type:'getposts', payload:data.result})
    } catch (error) {
        console.log(error);
    }
}
